  false,\n\t\"url\": null,\n\t\"notes\": \"The Groundwater Site Inventory, GWSI, database
  is ADWRs main repository for statewide groundwater data. The GWSI consists of field
  verified data regarding wells and springs collected by personnel from Hydrology
  Divisions Basic Data Section, the U.S. Geological Survey, and other cooperating
  agencies. The information in GWSI is constantly being updated by ongoing field investigations
  and through a statewide network of water level and water quality monitoring sites.This
  handbook has been developed for use by both the Basic Data section and other Department
  personnel. With the Departments move to a PC based client server network, the data
  in GWSI have become more readily available to everyone within the Department. This
  handbook has been developed to help department personnel understand the GWSI database
  system, the data available in the system, and how the different data tables in the
  system can be used to extract meaningful information from the GWSI.\",\n\t\"license_title\":
